import Head from "next/head";
import Layout from "components/layout.landing";
import Landing from "components/landing/sections/index/Landing";
import HeroStat from "components/landing/sections/index/HeroStat";
import Duo from "components/landing/sections/index/Duo";

export default function Index() {
  return (
    <Layout>
      <Head>
        <title>Neudify | Wellness in the nude</title>
        <meta
          name="description"
          content="Improve your intimate life. Your toolkit for a vibrant and healthy sex life."
        />
        <meta name="keywords" content="wellness, sex, sextech" />
      </Head>
      <Landing />
      <HeroStat/>
      <Duo/>
    </Layout>
  );
}
